int d2b(float num) {
	float num_abs = (num > 0) ? num : num * (-1);
	int decimal = num_abs;
	float frac  = num_abs-decimal;
	int base    =decimal<<21;
	float remain=frac;
	int result=0;
	int i;
	for (i=-1;i>-21;i--){
		if (remain>=pow(2,i)){
	      	remain-=pow(2,i);
	      	result=result| 0x1;
	    }
	    result=result<<1;
	}
	if (num < 0) {
		return ~(result+base) + 0x1;
	}
	return result+base;
}

double b2d(int num) {
	double result = 0;
	int decimal = num & 0x1fffff;
	int i, j;
	for (i = 21; i > 0; i--) {
		result += (decimal & 0x1) /pow(2, i);
		decimal = decimal >> 1;
	}
	int fraction = num >> 21;
	for (j = 0; j < 4; j++) {
		result += (j == 3) ? (-1 * (fraction & 0x1) * pow(2, j)) : ((fraction & 0x1) * pow(2, j));
		fraction = fraction >> 1;
	}
	return result;
}

void maximum(double *a,double *max,int *max_index, int a_num){
	int i;
	for (i=0;i<a_num;i++){
		//printf("array: %f\n", a[i]);
	    if (a[i] > *max){
		    *max= a[i];
		    *max_index = i;
	    }
	}
}

void minimum(double *a,double *min, int *min_index, int a_num){
	int i;
	for (i=0;i<a_num;i++){
	    if (a[i] < *min){
	      *min= a[i];
	      *min_index = i;
	    }
  	}  
}

void nms(double *r){
	int i, j, ii, jj;
    for (i=0;i<28;i++){
      for (j=0;j<28;j++){
        double max = 0;
        int idx = 0;
        for (ii=0;ii<3;ii++){
          for (jj=0;jj<3;jj++){
            if( r[(i+ii)*30+j+jj] > max){
              max = r[(i+ii)*30+j+jj];
              idx = (i+ii)*30+j+jj;
            }
          }
        }
        for (ii=0;ii<3;ii++){
          for (jj=0;jj<3;jj++){
            if ((i+ii)*30+j+jj == idx){
              r[idx]=max;
            }
            else{
              r[(i+ii)*30+j+jj]=0;
            }
          }
        }  
      }
    }
}

